//import logo from './logo.svg';
//import './App.css';

const SearchPanel = () => {
  return (
    <p>
      <input type="text" placeholder="search"></input>
    </p>
  );
};

const ReactMainLink = () => {
  return (
    <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
  )
}
function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <SearchPanel />
        <ReactMainLink />
      </header>
    </div>
  );
}

export default App;
